INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 1, 2834, 2, 91002, 20063115, "ペコリーヌとの出会い", "フリーマーケット会場", 5118061, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 1, 2835, 2, 91002, 20063115, "マホとの出会い", "フリーマーケット会場", 5118062, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 1, 2837, 2, 91002, 20063115, "アキノとの出会い", "ランドソル市街地", 5118063, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 1, 4108402, 2, 91002, 20063115, "ジュンとの出会い", "フリーマーケット会場", 5118064, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 1, 4107402, 2, 91002, 20063115, "カオリとの出会い", "フリーマーケット会場", 5118065, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 1, 9000227, 2, 91002, 20063115, "ニノンとの出会い", "オーエド町", 5118066, 10118, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 1, 2101181, 3, 91002, 20063115, "スズナとの出会い", "フリーマーケット会場", 5118067, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 1, 4109402, 3, 91002, 20063115, "ナナカとの出会い", "ランドソル市街地", 5118068, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 1, 4305402, 3, 91002, 20063115, "キャル＆コッコロとの出会い", "フリーマーケット会場", 5118069, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 1, 4101402, 3, 91002, 20063115, "ユカリとの出会い", "ランドソル市街地", 5118070, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 1, 4106402, 3, 91002, 20063115, "アオイとの出会い", "ランドソル市街地", 5118071, 10118, 0);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (40, 8, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 1, 2836, 3, 91002, 20063115, "シノブとの出会い", "フリーマーケット会場", 5118072, 10118, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 0, "彼女たちの新たな日常", 0, 0, 0, 0, 1, 0, 20063115, "オープニング", 0, 5118600, 10118, 0);
